function renderFrame(index: number) {
    index |= 0
    const frame = ani[index]
    const isHorizonScan = (frame[0] >> 7) == 0
    let offsetBuf = 1
    let iScreen = 0
    for (; offsetBuf < frame.length; offsetBuf++) {
        const isBlack = frame[offsetBuf] > 127
        let count = frame[offsetBuf] & 0b01111111
        if (offsetBuf + 1 < frame.length && (frame[offsetBuf + 1] > 127) == isBlack) {
            offsetBuf++
            count *= 128
            count += frame[offsetBuf] & 0b01111111
        }
        if (isHorizonScan) {
            for (let i = 0; i < count; i++)
                bg.setPixel(20 + (iScreen + i) / 120, (iScreen + i) % 120, isBlack ? 15 : 1)
        } else {
            for (let i = 0; i < count; i++)
                bg.setPixel(20 + (iScreen + i) % 120, (iScreen + i) / 120, isBlack ? 15 : 1)
        }
        iScreen += count
    }
}


